function [E, inLIdx, stat] = RQuEst(mP1, mP2, varargin)
  statusCode = struct(... % List of status codes
    'NoError',           int32(0),...
    'NotEnoughPts',      int32(1),...
    'NotEnoughInliers',  int32(2));
  [pts1, pts2, K1, K2, pars, oClass] = parseInputs(mP1, mP2, varargin{:});
  numPts = size(pts1, 1);
  
  sampSz = 6;
  
  if numPts < sampSz
    E = eye(3, oClass); % default outputs
    inLIdx = false(numPts, 1);
    stat = statusCode.NotEnoughPts;
  else



    [pts1n, pts2n] = pxls2NormCoords(pts1, pts2, K1, K2);
    pars.sampleSize = sampSz;
    pars.recomputeModelFromInliers = true;

    funcs.fitFunc = @quest_algorithm;
    funcs.evalFunc = @evalEssential;
    funcs.checkFunc = @check;
    
    [isFound, E, inLIdx] = vision.internal.ransac.msac(...
      cat(3, pts1n, pts2n), pars, funcs, K1, K2, oClass);


    if isFound
      stat = statusCode.NoError;
      E = cast(normalizeEssentialMatrix(E), oClass);
    else
      E = eye(3, oClass); % default outputs
      inLIdx = false(numPts, 1);
      stat = statusCode.NotEnoughInliers;
    end
  end
  if nargout < 3
    checkRuntimeStatus(statusCode, stat)
  end
end

%==========================================================================
% Check runtime status and report error if there is one
%==========================================================================
function checkRuntimeStatus(statusCode, status)
  coder.internal.errorIf(status==statusCode.NotEnoughPts, ...
    'vision:points:notEnoughMatchedPts', 'mP1', ...
    'matchedPoints2', 5);
  coder.internal.errorIf(status==statusCode.NotEnoughInliers, ...
    'vision:points:notEnoughInlierMatches', 'mP1', ...
    'matchedPoints2');
end

%--------------------------------------------------------------------------
function dists = evalEssential(Es, x, varargin)
  K1 = varargin{1};
  K2 = varargin{2};
  outputClass = varargin{3};
  x1 = (x(:,:,1) * K1)';
  x2 = (x(:,:,2) * K2)';
  numSols = numel(Es);
  dists = zeros(size(x1, 2), numSols, outputClass);
  for i = 1:numSols
    F = K2 \ Es{i} / K1';
    Fx1 = F*x1;
    epipDists = sum(x2 .* Fx1);
    Ftx2 = F'*x2;
    % Sampson distance
    dists(:,i) =  epipDists.^2 ./ (sum(Fx1(1:2,:).^2) + sum(Ftx2(1:2,:).^2));
  end
end

%--------------------------------------------------------------------------
% Convert the points from pixels no homogeneous normalized image
% coordinates
function [pts1n, pts2n] = pxls2NormCoords(pts1, pts2, K1, K2)
  numPts = size(pts1, 1);
  pts1 = [pts1, ones(numPts, 1)];
  pts2 = [pts2, ones(numPts, 1)];
  pts1n = pts1 / K1;
  pts2n = pts2 / K2;
end

%--------------------------------------------------------------------------
function E = normalizeEssentialMatrix(E)
  if iscell(E)
    E = E{1};
  end  
  E = E / norm(E);
  if E(end) < 0
    E = -E;
  end
end

%--------------------------------------------------------------------------
function [pts1, pts2, K1, K2, RANSACPars, oClass] = parseInputs( mP1, mP2, varargin)
  [pts1, pts2] = vision.internal.inputValidation.checkAndConvertMatchedPoints(...
    mP1, mP2, mfilename, 'mP1', 'mP2');
  pts1 = cast(pts1, 'double');
  pts2 = cast(pts2, 'double');
  oClass = class(pts1);
  [K1, K2, idx] = parseCameraParams(oClass, varargin{:});
  defaults = struct('MaxNumTrials',1000, 'Confidence',99, 'MaxDistance',0.1);
  if isempty(coder.target)
    RANSACPars = parseRANSACParamsMatlab(defaults, varargin{idx:end});
  else
    RANSACPars = parseRANSACParamsCodegen(defaults, varargin{idx:end});
  end
end

%--------------------------------------------------------------------------
function ransacParams = parseRANSACParamsMatlab(defaults, varargin)
  parser = inputParser;
  parser.FunctionName = mfilename;
  parser.addParameter('MaxNumTrials', defaults.MaxNumTrials, @checkMaxNumTrials);
  parser.addParameter('Confidence', defaults.Confidence, @checkConfidence);
  parser.addParameter('MaxDistance', defaults.MaxDistance, @checkMaxDistance); 
  parser.parse(varargin{:});
  ransacParams.confidence = parser.Results.Confidence;
  ransacParams.maxDistance = parser.Results.MaxDistance;
  ransacParams.maxNumTrials = parser.Results.MaxNumTrials;
end

%--------------------------------------------------------------------------
function ransacParams = parseRANSACParamsCodegen(defaults, varargin)
  for n = 1:numel(varargin) % Check for string and error
    coder.internal.errorIf(isstring(varargin{n}), ...
      'vision:validation:stringnotSupportedforCodegen');
  end
  % Instantiate an input parser
  parms = struct( ...
      'MaxNumTrials',       uint32(0), ...
      'Confidence',         uint32(0), ...
      'MaxDistance',        uint32(0));
  popt = struct( ...
      'CaseSensitivity', false, ...
      'StructExpand',    true, ...
      'PartialMatching', false);
  % Specify the optional parameters
  optarg = eml_parse_parameter_inputs(parms, popt, varargin{:});
  ransacParams.maxNumTrials = eml_get_parameter_value(optarg.MaxNumTrials,...
      defaults.MaxNumTrials, varargin{:});
  ransacParams.confidence   = eml_get_parameter_value(optarg.Confidence,...
      defaults.Confidence, varargin{:});
  ransacParams.maxDistance  = eml_get_parameter_value(optarg.MaxDistance,...
      defaults.MaxDistance, varargin{:});
  checkMaxNumTrials(ransacParams.maxNumTrials);
  checkConfidence  (ransacParams.confidence);
  checkMaxDistance (ransacParams.maxDistance);
end

%--------------------------------------------------------------------------
function [K1, K2, idx] = parseCameraParams(outputClass, varargin)
  camP1 = varargin{1};
  validateattributes(camP1, {'cameraParameters','cameraIntrinsics'}, {'scalar'}, mfilename);
  if isa(camP1, 'cameraIntrinsics')
    camP1 = camP1.CameraParameters;
  end
  K1 = cast(camP1.IntrinsicMatrix, outputClass);
  if numel(varargin) > 1 && (isa(varargin{2}, 'cameraParameters') || isa(varargin{2}, 'cameraIntrinsics'))
    validateattributes(varargin{2}, {'cameraParameters','cameraIntrinsics'}, {'scalar'}, mfilename);
    if isa(varargin{2}, 'cameraIntrinsics')
      cameraParams2 = varargin{2}.CameraParameters;
    else
      cameraParams2 = varargin{2};
    end
    K2 = cast(cameraParams2.IntrinsicMatrix, outputClass);
    idx = 3;
  else
    K2 = K1;
    idx = 2;
  end
end

