    {'scalar', 'nonsparse', 'real', 'positive', '<', 100}, mfilename, ...
    'Confidence');
  tf = true;
end

%--------------------------------------------------------------------------
function tf = checkMaxDistance(value)
  validateattributes(value,{'single','double'}, ...
    {'real', 'nonsparse', 'scalar','nonnegative','finite'}, mfilename, ...
    'MaxDistance');
  tf = true;
end

